import React from "react";
import "./style.css";

function Coding() {
  return (
    <div>
    <a href="https://www.linkedin.com/in/eurbaez/"> 
    <img class="img-fluid" id="geek-image"
                  src="https://icon-library.net/images/linkedin-black-icon/linkedin-black-icon-26.jpg"
                  alt="Audio Engineering"/>
    <div class="box-1 position-absolute">Ad-Tech Experience</div>
    </a> 
    </div>
  );
}

export default Coding;
